pragma solidity ^0.8.0;

import "./Greeter.sol";
import "./SafeMath.sol";
import "hardhat/console.sol";

contract Test {

    using SafeMath for uint256;

    Greeter public greeter;
    address public greeterAddress;

    constructor(address addr){
        greeter = Greeter(addr);
        greeterAddress = addr;
    }

    function greet() public view returns (string memory){
        return greeter.greet();
    }

    function setGreeting(string memory _greeting) public {
        console.log("From test -> changing greeting to '%s'", _greeting);
        greeter.setGreeting(_greeting);
    }

    function newFunction() public returns (string memory greeting){
        Greeter gt = new Greeter("from test");
        greeting = gt.greet();
        console.log("new greeter's:", greeting);
        return greeting;
    }

    function randomNum(uint256 min, uint256 max) public view returns (uint256){
        require(min < max, "require min < max");
        uint256 distance = max - min;
        uint256 randomPercent = uint256(keccak256(abi.encodePacked(block.difficulty, block.timestamp, msg.sender, distance))) % 100;
        return min + distance * randomPercent / 100;
    }

    function getMath() public pure returns (uint256){
        uint256 a = 100;
        uint256 b = 1;
        uint256 c = 2;
        return a.add(b).mul(c);
    }

    function getDays() public pure returns (uint256 a){
        a = 365 days;
    }

    function timeStamp32() public view returns (uint32 blockTimestamp){
        blockTimestamp = uint32(block.timestamp % 2 ** 32);
        console.log("time", blockTimestamp);
    }
}
